import React, { Component }  from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';

class App extends Component {
  render() {
    return (
      <div>
        <h1>Pixel Mapper</h1>
          <Game />
        <div> 
        </div>
      </div>
    );
  }
}

class Game extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cells: WorldPixelMap(),
      draw: 0
      
    };
    this.toggleValue = this.toggleValue.bind(this)
    this.toggleDraw = this.toggleDraw.bind(this)
  }

  toggleValue(i) {
    const cells= this.state.cells.slice();
    if (cells[i] === this.state.draw){
      cells[i] = 0;
    } else {
      cells[i] = this.state.draw;
    }
    this.setState({cells: cells})
  }

  toggleDraw(i) {
    this.setState({draw: i})
  }

  renderCells() {
    return (
      "[" + this.state.cells.join(",") + "]"
    )
  }

  getClass(cell) {
    if (cell===0) {
      return "zero";
    } else if (cell===1) {
      return "one";
    } else if (cell===2) {
      return "two";
    } else if (cell===3) {
      return "three";
    } else if (cell===4) {
      return "four";
    } else if (cell===5) {
      return "five";
    } else if (cell===6) {
      return "six";
    } else if (cell===7) {
      return "seven";
    }
  }

  render () {
    return (
      <div> 
                {this.state.cells.join(",")}
        <br/><br/>
        <div>
          <button onClick={() => this.toggleDraw(0)} className="zero">0</button>
          <button onClick={() => this.toggleDraw(1)} className="one">1</button>
          <button onClick={() => this.toggleDraw(2)} className="two">2</button>
          <button onClick={() => this.toggleDraw(3)} className="three">3</button>
          <button onClick={() => this.toggleDraw(4)} className="four">4</button>
          <button onClick={() => this.toggleDraw(5)} className="five">5</button>
          <button onClick={() => this.toggleDraw(6)} className="six">6</button>
          <button onClick={() => this.toggleDraw(7)} className="seven">7</button>
          
        </div>
        {/* <img src="https://msr7.net/images/earth-map-black-and-white-15.jpg" /> */}
        <div className='grid'>
          <div className='cell-container'>
          {this.state.cells.map((cell, index) => (
            <button
              key={index} 
              className={this.getClass(cell)} 
              value={cell} 
              onClick={() => this.toggleValue(index)}>
            </button>
          ))}      
          </div>
        </div>
      </div>
    )
  }
}

ReactDOM.render(<App />, document.getElementById('root'));

